public class Q392 {
	  public static boolean isSubsequence(String s, String t) {
	        char[] cha = s.toCharArray();
	        int index = -1;
	       
	        for (char c : cha) {
				index = t.indexOf(c,index+1);				
				if (index == -1) {
					return false;
				}
			}
	        return true;
	    }
	  
	  public static void main(String[] args) {
		String s = "leeeeetcode";
		String t = "";
		System.out.println(isSubsequence(s, t));
		
	}
}


